import React, { Component } from 'react'
import { Link, withRouter } from 'react-router-dom'
import AppBar from '@material-ui/core/AppBar';
import './Navbar.css';
import LoginRegLink from './LoginRegLink'
import SvgIcon from '@material-ui/core/SvgIcon';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';




class Navbar extends Component {
    logOut(e) {
        e.preventDefault()
        localStorage.removeItem('usertoken')
        console.log("See ya")
        this.props.history.push(`/`)
    }

    handlePageChangeToYourEvents(e) {
        e.preventDefault()
        window.location = "/userEvents";
    }

    handlePageChangeToHome(e) {
        e.preventDefault()
        window.location = "/";
    }

    handlePageChangeToProfile(e) {
        e.preventDefault()
        window.location = "/profile";
    }

    handlePageChangeToCreateEvent(e) {
        e.preventDefault()
        window.location = "/createEvent";
    }

    handlePageChangeToAllEvents(e) {
        e.preventDefault()
        window.location = "/allEvents";
    }

    render() {

        function HomeIcon(props) {
            return (
                <SvgIcon {...props}>
                    <path d="M10 20v-6h4v6h5v-8h3L12 3 2 12h3v8z" />
                </SvgIcon>
            );
        }
        const userLink = (

            <AppBar position="static" className="AppBarContainer">
                <Grid container direction="row" justify="space-between" alignItems="center" spacing={0}>
                    <Grid item >
                        <Link to="/" >
                            <HomeIcon color="action" className="itemNav" />
                        </Link>
                    </Grid>
                    <Grid item >
                           <Button color="default"
                                   onClick={this.handlePageChangeToProfile.bind(this)}>
                               User
                           </Button>
                    </Grid>
                    <Grid item >
                            <Button color="default"
                                    onClick={this.logOut.bind(this)}>
                                    Logout
                                    </Button>
                    </Grid>
                    <Grid item >
                            <Button color="default"
                                    onClick={this.handlePageChangeToCreateEvent.bind(this)}>
                                Create event
                            </Button>
                    </Grid>
                    <Grid item >
                            <Button color="default"
                                    onClick={this.handlePageChangeToAllEvents.bind(this)}>
                                All events
                            </Button>
                    </Grid>
                    <Grid item >
                            <Button color="default"
                                    onClick={this.handlePageChangeToYourEvents.bind(this)}>
                                Your Events
                            </Button>
                    </Grid>
                </Grid>
            </AppBar>

        )
        return (
            <nav className="AppBarContainer">
                {localStorage.usertoken ? userLink : loginRegLink}
            </nav>

        )
    }
}
export default withRouter(Navbar)
